import React from 'react';
import './ClassicalCardStyles.scss';
import {withRouter} from 'react-router-dom';
import ClassicalYTpage from '../../pages/classical-search-page/ClassicalYoutubePage';

import { compose } from 'redux';
import { connect } from 'react-redux';
import { change_youtube_url } from '../../actions';

const mapDispatchToProps = dispatch => {
	return {
		change_youtube_url: (YTurl) => dispatch(change_youtube_url(YTurl))
	}
}

const ClassicalCard = ({id, name, composition, work_type, genre, yt_url, history, match, change_youtube_url}) => {
	const linkUrl = 'classical_search_yt';
  const handleClick = (i) => {
    change_youtube_url(i);
    history.push(`${linkUrl}`);
  }

	return(
		<div className='dib br4 pa3 ma2 grow bw2 shadow-5 c-card-display'>
			<h2 className='composition-font'>{composition}</h2>
			<h4 className='worktype-font'>{work_type}</h4>
			<h4 className='genre-font'>Genre: {genre}</h4>
			<button 
				className="c-box-container"
				onClick={() =>
					handleClick(yt_url)}
			>
				HIT THIS COMPOSITION
			</button>
		</div>
	)
}


export default compose(
  withRouter,
  connect(null, mapDispatchToProps)
)(ClassicalCard);
